import React from 'react';
import Dev from './Dev';

function DevList(props) {
    let devs = props.map((dev) => {
        return <Dev company={dev.company} languages={dev.languages}/>
    })
        return (
            <div>
                {devs}
            </div>
    )
}

export default DevList;
